using System;
using System.IO;
using System.Net;
using System.Net.Http;
using System.Text;
using Newtonsoft.Json;
using NUnit.Framework;

namespace ImageDownloaderTests
{
    public class Tests
    {
        private readonly string apiUrl = "https://localhost:44316/download";
        private WebClient _webClient;

        [SetUp]
        public void Setup()
        {
            _webClient= new WebClient();
        }

        [Test]
        public void TestDownloadImagesFromFiles()
        {
            using (var httpClient = new HttpClient())
            {
                MultipartFormDataContent form = new MultipartFormDataContent();
                var firstImage = File.ReadAllBytes("TestImages/1.jpg");
                var secondImage = File.ReadAllBytes("TestImages/2.jpg");
                form.Add(new ByteArrayContent(firstImage, 0, firstImage.Length), "firstImage", "1.jpg");
                form.Add(new ByteArrayContent(secondImage, 0, secondImage.Length), "secondImage", "2.jpg");
                var response = httpClient.PostAsync(apiUrl, form);
                response.Wait(TimeSpan.FromSeconds(10));

                var result = response.Result;
                result.EnsureSuccessStatusCode();
            }
        } 
        [Test]
        public void TestDownloadBase64()
        {
            using (var httpClient = new HttpClient())
            {
                var data = new[] { "data:image/jpeg;base64," };
                var content = new StringContent(JsonConvert.SerializeObject(data), Encoding.UTF8, "application/json");
                var response = httpClient.PostAsync(apiUrl, content);
                response.Wait(TimeSpan.FromSeconds(10));

                var result = response.Result;
                result.EnsureSuccessStatusCode();
            }
        } 
        [Test]
        public void TestDownloadImagesByUrl()
        {
            using (var httpClient = new HttpClient())
            {
                var content = new StringContent("https://i.pinimg.com/originals/70/40/8c/70408cd6287660691d8ae788c1e64f1e.jpg", Encoding.UTF8, "text/html");
                var response = httpClient.PostAsync(apiUrl, content);
                response.Wait(TimeSpan.FromSeconds(10));

                var result = response.Result;
                result.EnsureSuccessStatusCode();
            }
        }
        [Test]
        public void TestInvalidJsonData()
        {
            using (var httpClient = new HttpClient())
            {
                var data = new[] { "invalid data" };
                var content = new StringContent(JsonConvert.SerializeObject(data), Encoding.UTF8, "application/json");
                var response = httpClient.PostAsync(apiUrl, content);
                response.Wait(TimeSpan.FromSeconds(10));

                var result = response.Result;
                Assert.IsTrue(result.StatusCode == HttpStatusCode.BadRequest);
            }
        }
    }
}